import React from 'react';
import './home.scss';

function Home() {
  return (
      <main className="container-fluid h-100">
        <div className="row">
        <div className="col-lg-6 bg-info">Hej</div>
        <div className="col-lg-6 bg-dark text-white">Hej</div>
        </div>
      </main>
  );
}

export default Home;
